import { GET_CODE_PHIM_BOOKING } from "../constants/bookingCodePhim.constant"

export const getMaPhimBooking = (maPhim) => {
    return {
        type: GET_CODE_PHIM_BOOKING,
        payload: maPhim,
    }
}
